INSERT INTO vdydev_mail_template VALUES("1","Proves","&lt;p&gt;INSERT INTO vdydev_mail_template VALUES("2","probando probando probando","&lt;p&gt;INSERT INTO vdydev_mail_template VALUES("3","probando probando probando","&lt;p&gt;INSERT INTO vdydev_mail_template VALUES("4","probando probando probando","&lt;p&gt;INSERT INTO vdydev_mail_template VALUES("5","probando probando probando","&lt;p&gt;INSERT INTO vdydev_mail_template VALUES("6","probando probando probando","&lt;p&gt;INSERT INTO vdydev_mail_template VALUES("7","probando probando probando","&lt;p&gt;INSERT INTO vdydev_news VALUES("5","Ono estudia un sistema de filtrado que ralentice el streaming de partidos de f&uacute;tbol","andreums","prueba","2011-11-30 14:14:09","&lt;p class=&quot;categories&quot;&gt;INSERT INTO vdydev_news VALUES("6","El taller que sale a por los clientes","andreums","taller-que-sale-por-los-clientes","2012-02-10 17:47:16","El taller que sale a por los clientes Un negocio de mec&amp;aacute;nica de Valencia evita los despidos y remonta gracias a la b&amp;uacute;squeda de coches con desperfectos y los presupuestos instant&amp;aacute;neos &amp;nbsp;","&amp;nbsp; &amp;nbsp; Levante-EMV.com &amp;raquo; Comunitat Valenciana &amp;nbsp; El taller que sale a por los clientes Un negocio de mec&amp;aacute;nica de Valencia evita los despidos y remonta gracias a la b&amp;uacute;squeda de coches con desperfectos y los presupuestos instant&amp;aacute;neos 18-11-2011 &amp;nbsp; VOTE ESTA NOTICIA&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; El equipo de talleres Alberotecnic, situado en el n&amp;uacute;mero 14 de la calle Totana, en Valencia.&amp;nbsp;Manuel Molines Alberotecnic se ha cansado de esperar a los clientes y ha decidido salir a buscarlos. Despu&amp;eacute;s de ver c&amp;oacute;mo el taller se vaciaba poco a poco de coches por culpa de la crisis, decidieron trabajar de forma diferente. Iban a recortar personal pero una f&amp;oacute;rmula ingeniosa ha permitido mantener todos los empleos. Ahora, el taller vuelve a estar hasta arriba de trabajo. JAVIER P&amp;Eacute;REZ DE LA CRUZ, VALENCIA &amp;laquo;Un d&amp;iacute;a nos reunimos y dijimos: &amp;iquest;qu&amp;eacute; hacemos?&amp;iquest;Tiramos a dos trabajadores o conseguimos m&amp;aacute;s clientes?&amp;raquo; As&amp;iacute; es como Manuel Moya, el gerente del taller Alberotecnic S. L. de Valencia, se propuso agudizar el ingenio y encontrar una f&amp;oacute;rmula que le permitiera mantener a sus 15 empleados. &amp;laquo;Yo no pod&amp;iacute;a mirar a la cara a alguno de los trabajadores y despedirle despu&amp;eacute;s de tanto tiempo. Hab&amp;iacute;a que hacer algo diferente&amp;raquo;. Ese algo diferente fue abandonar el cl&amp;aacute;sico modelo de taller que espera a que los coches entren por su puerta. Ellos decidieron organizarse y salir a la calle a buscarlos. &amp;laquo;El &amp;eacute;xito no ha podido ser mayor. Ahora acabo de estar con un cliente que ha venido de l&amp;acute;Eliana a que le hici&amp;eacute;ramos un presupuesto. Yo le he dicho que no hac&amp;iacute;a falta que lo trajera, &amp;iexcl;que nosotros vamos hasta all&amp;iacute; para hac&amp;eacute;rselo!&amp;raquo;, exclama alegre el gerente. Y es que en las cuatro semanas que hace que iniciaron el nuevo servicio, el negocio va viento en popa. &amp;laquo;Hemos recibido llamadas de todas partes, incluso de tan lejos como Requena. Tambi&amp;eacute;n de Bilbao, Barcelona y Oviedo interesados en c&amp;oacute;mo llevamos el tema legal&amp;raquo;, contin&amp;uacute;a Moya. La idea es tan sencilla como brillante. Se trata de recorrer la ciudad en busca de coches con peque&amp;ntilde;os problemas de chapa, pintura o neum&amp;aacute;ticos. Una vez localizados, se fotograf&amp;iacute;an y se vuelcan los datos en un ordenador port&amp;aacute;til. &amp;laquo;Hemos creado una base de datos que nos permite estimar los da&amp;ntilde;os y realizar un presupuesto muy exacto en el mismo lugar en el que encontramos el coche&amp;raquo;, explica. El papel se fija al parabrisas y se espera a que el futuro cliente se sorprenda al ver que se trata de un presupuesto para reparar su propio coche. Todo son facilidades, tambi&amp;eacute;n en el precio final. &amp;laquo;Al calcular el precio incluimos un descuento para que sea m&amp;aacute;s bajo que el de cualquier otro taller&amp;raquo; asegura el gerente del Alberotecnic. Vicente Valladolid es uno de los dos encargados del taller que patrulla por las calles. Su radio de acci&amp;oacute;n es, seg&amp;uacute;n afirma, toda la ciudad de Valencia. &amp;laquo;Me centro en cosas peque&amp;ntilde;as, golpes, abolladuras y tambi&amp;eacute;n en los neum&amp;aacute;ticos. Los presupuestos nunca superan los 400 euros&amp;raquo;, aclara Valladolid. El d&amp;iacute;a lo cierra con cerca de 50 estimaciones, que deben ser multiplicadas por dos, es decir, cien posibles nuevos clientes cada d&amp;iacute;a. &amp;laquo;Adem&amp;aacute;s est&amp;aacute;n las llamadas de los clientes que nos piden un presupuesto expresamente. Con ellos quedamos, y le echamos un vistazo al coche&amp;raquo;, agrega el perito. Un fil&amp;oacute;n que, imagina, pronto copiar&amp;aacute;n otros talleres mec&amp;aacute;nicos. &amp;laquo;Ahora con estar tal como estamos me conformo, que no es poco en estos tiempos&amp;raquo;, responde Manuel Moya a la pregunta de si piensa expandir el negocio. &amp;Eacute;l se neg&amp;oacute; a reducir gastos y a despedir a trabajadores,es decir, a tomar la decisi&amp;oacute;n m&amp;aacute;s frecuente para luchar contra la falta de actividad y clientela. En cambio, innov&amp;oacute; y facilit&amp;oacute; el servicio a los clientes. Ellos han respondido llenando el taller porque a pesar de la crisis econ&amp;oacute;mica, la gente todav&amp;iacute;a quiere reparar sus coches. &amp;nbsp; Buscar posibles clientes | Fotografiar golpes y abolladuras Vicente Valladolid es uno de los dos peritos que captan posibles clientes. Ambos recorren la ciudad en busca de peque&amp;ntilde;os desperfectos que necesiten ser reparados. &amp;laquo;Me centro en zonas en las que haya mucha aglomeraci&amp;oacute;n de coches, como aparcamientos de centros comerciales&amp;raquo;, aclara. Calcular el presupuesto | Ordenador e impresora preparados para actuar Cuando busca, Vicente viaja con un ordenador y una impresora para elaborar los presupuestos al instante. Una base de datos le permite hacerlo de forma r&amp;aacute;pida y precisa. Su objetivo son reparaciones peque&amp;ntilde;as que no superen los 400 euros porque, asegura, as&amp;iacute; es &amp;laquo;m&amp;aacute;s f&amp;aacute;cil&amp;raquo; que el cliente responda. A esperar la llamada | Presupuesto en el parabrisas Los cerca de cien presupuestos diarios a autom&amp;oacute;viles estacionados dan sus frutos ya que mucha gente muestra inter&amp;eacute;s. Adem&amp;aacute;s el boca a oreja ha comenzado a circular y Alberotecnic recibe llamadas desde todas las partes de la C. Valenciana. &amp;laquo;Incluso desde tan lejos como Requena&amp;raquo;, a&amp;ntilde;ade el gerente. &amp;nbsp;","1");
