\n	&lt;a href=&quot;http://bandaancha.eu/articulos/operadores/ono&quot;&gt;ONO&lt;/a&gt;, &lt;a href=&quot;http://bandaancha.eu/articulos/software/p2p/capado&quot;&gt;Capado&lt;/a&gt;&lt;/p&gt;\n&lt;h1&gt;\n	Ono estudia un sistema de filtrado que ralentice el streaming de partidos de f&amp;uacute;tbol&lt;/h1&gt;\n&lt;p&gt;\n	Ono estar&amp;iacute;a estudiando la implantaci&amp;oacute;n de un sistema que permita &lt;strong&gt;interceptar y ralentizar el streaming de v&amp;iacute;deo&lt;/strong&gt; de las retransmisiones deportivas por internet, de forma que no sea viable su visualizaci&amp;oacute;n. El objetivo, compartido por uno de sus directivos recientemente, ser&amp;iacute;a frenar el &amp;quot;consumo de partidos pirata&amp;quot;.&lt;/p&gt;\n","&lt;p class=&quot;categories&quot;&gt;\n	&lt;a href=&quot;http://bandaancha.eu/articulos/operadores/ono&quot;&gt;ONO&lt;/a&gt;, &lt;a href=&quot;http://bandaancha.eu/articulos/software/p2p/capado&quot;&gt;Capado&lt;/a&gt;&lt;/p&gt;\n&lt;h1&gt;\n	Ono estudia un sistema de filtrado que ralentice el streaming de partidos de f&amp;uacute;tbol&lt;/h1&gt;\n&lt;p&gt;\n	Ono estar&amp;iacute;a estudiando la implantaci&amp;oacute;n de un sistema que permita &lt;strong&gt;interceptar y ralentizar el streaming de v&amp;iacute;deo&lt;/strong&gt; de las retransmisiones deportivas por internet, de forma que no sea viable su visualizaci&amp;oacute;n. El objetivo, compartido por uno de sus directivos recientemente, ser&amp;iacute;a frenar el &amp;quot;consumo de partidos pirata&amp;quot;.&lt;/p&gt;\n&lt;p&gt;\n	La primicia &lt;a href=&quot;http://www.neeo.es/index.php?option=com_content&amp;amp;view=article&amp;amp;id=9288:ono-prepara-el-lcapado-del-futbol-en-director-para-sus-conexiones-de-internet&amp;amp;catid=1:noticias&amp;amp;Itemid=1381&quot;&gt;la publica neeo.es&lt;/a&gt; sin citar ninguna fuente. Seg&amp;uacute;n este portal, que en numerosas ocasiones ha adelantado informaciones sobre la operadora que posteriormente han resultado ser ciertas, Ono est&amp;aacute; &amp;quot;estudiando un sistema de gesti&amp;oacute;n de tr&amp;aacute;fico que dificulte la posibilidad del &lt;em&gt;streaming&lt;/em&gt; para estos partidos&amp;quot;.&lt;/p&gt;\n&lt;p&gt;\n	Para saber a ciencia cierta si el flujo de v&amp;iacute;deo que est&amp;aacute; recibiendo un usuario corresponde a una retransmisi&amp;oacute;n deportiva, la &lt;strong&gt;&amp;uacute;nica posibilidad es emplear hardware DPI que analice el contenido de los paquetes transmitidos por la red y baje la prioridad&lt;/strong&gt; de aquellos que han sido identificados. El efecto ser&amp;iacute;a que la velocidad a la que el cliente recibe el &lt;em&gt;streaming&lt;/em&gt; descender&amp;iacute;a, provocando cortes e interrupciones en la reproducci&amp;oacute;n. Otra posibilidad es que la identificaci&amp;oacute;n de los paquetes se base en un conjunto de reglas. Por ejemplo, la ralentizaci&amp;oacute;n de los paquetes de tr&amp;aacute;fico UDP con origen en ciertos servidores. En este caso, no ser&amp;iacute;a necesario analizar el contenido de los paquetes, pero el filtrado podr&amp;iacute;a perjudicar a usuarios que no est&amp;aacute;n visualizando las emisiones que se pretenden bloquear. Con esta segunda opci&amp;oacute;n, &lt;strong&gt;Ono evitar&amp;iacute;a inclumplir la ley&lt;/strong&gt;. Hay que recordar que recientemente el &lt;a href=&quot;http://bandaancha.eu/articulo/8165/inspeccionar-trafico-bloquear-intercambio-archivos-ilegal-segun-tribunal-justicia-ue&quot;&gt;Tribunal de Justicia de la UE confirm&amp;oacute; que el DPI invad&amp;iacute;a los derechos fundamentales&lt;/a&gt;.&lt;/p&gt;\n","1");
