\n<div class=\"thumbcaption\">\n<div class=\"magnify\"><a href=\"/wiki/Archivo:Detalle_de_la_fachada_del_Palacio_del_Duque_de_Medina_Sidonia-Sanl%C3%BAcar_de_Barrameda.jpg\" class=\"internal\" title=\"Aumentar\"><img src=\"//bits.wikimedia.org/skins-1.18/common/images/magnify-clip.png\" width=\"15\" height=\"11\" alt=\"\" /></a></div>\nDetalle de la fachada de un inmueble: Se trata del Palacio del <a href=\"/wiki/Duque_de_Medina_Sidonia\" title=\"Duque de Medina Sidonia\" class=\"mw-redirect\">Duque de Medina Sidonia</a>, situado en <a href=\"/wiki/Sanl%C3%BAcar_de_Barrameda\" title=\"Sanlcar de Barrameda\">Sanlcar de Barrameda</a>.</div>\n</div>\n</div>\n<p>Se consideran <b>inmuebles</b> todos aquellos <a href=\"/wiki/Propiedad\" title=\"Propiedad\">bienes</a> considerados bienes races, por tener de comn la circunstancia de estar ntimamente ligados al suelo, unidos de modo inseparable, fsica o jurdicamente, al terreno, tales como las <a href=\"/wiki/Parcela\" title=\"Parcela\">parcelas</a>, urbanizadas o no, <a href=\"/wiki/Casa\" title=\"Casa\">casas</a>, naves <a href=\"/wiki/Industrial\" title=\"Industrial\" class=\"mw-redirect\">industriales</a>, o sea, las llamadas <a href=\"/wiki/Finca\" title=\"Finca\">fincas</a>, en definitiva, que son bienes imposibles de trasladar o separar del suelo sin ocasionar daos a los mismos, porque forman parte del terreno o estn anclados a l. Etimolgicamente su denominacin proviene de la palabra <i>inmvil</i>. A efectos jurdicos registrales, en algunas legislaciones los <a href=\"/wiki/Buque\" title=\"Buque\">buques</a> y las <a href=\"/wiki/Aeronave\" title=\"Aeronave\">aeronaves</a> tienen consideracin semejante a la de los bienes inmuebles.</p>\n<p>En <a href=\"/wiki/Derecho_civil\" title=\"Derecho civil\">derecho civil</a> comincin entre bienes muebles e inmuebles es muy importante en muchos supuestos. Tradicionalmente, han destacado las siguientes diferencias:</p>\n<ul>\n<li>Los bienes inmuebles pueden ser inscritos en el <i>Registro de bienes inmuebles</i> (<a href=\"/wiki/Registro_de_la_propiedad\" title=\"Registro de la propiedad\">Registro de la propiedad</a>), lo cual le da una mayor proteccin al propietario.</li>\n<li>Los bienes inmuebles son los nicos que pueden ser objeto de <a href=\"/wiki/Hipoteca\" title=\"Hipoteca\">hipoteca</a>.</li>\n<li>Los plazos de <a href=\"/wiki/Usucapi%C3%B3n\" title=\"Usucapin\">usucapin</a> o prescripcin adquisitiva son mucho mayores.</li>\n</ul>\n<p>Sin embargo, dicha lista no agota las especialidades, que son innumerables, dada la importancia que histricamente han tenido los bienes inmuebles en la economa, y la especialidad que se deriva de su fcil localizacin.</p>\n<p>No obstante, la distincin entre bienes muebles e inmuebles es rechazada por algunos autores modernos en cuanto el valor de los primeros puede superar el de los segundos. Consecuencia de ello, es la creacin de registros a los que pueden tener acceso determinados bienes muebles (aviones, automviles, buques, etc.), as como la posibilidad de que stos sean objeto de <a href=\"/wiki/Hipoteca\" title=\"Hipoteca\">hipoteca</a>. En este sentido, y por lo que respecta a <a href=\"/wiki/Espa%C3%B1a\" title=\"Espaa\">Espaa</a>, cabe sealar la <a rel=\"nofollow\" class=\"external text\" href=\"http://www.juecesdemocracia.es/legislacionvigente/civil/Derechosreales/Ley%20Hipoteca%20Mobiliaria%20y%20Prenda%20sin%20Desplazamiento.%20Ley%2016%20de%20diciembre%20de%201954..pdf\">Ley de Hipoteca mobiliaria y Prenda sin desplazamiento de la posesin</a> de 1954.</p>","","0","","","","0");



